import React from 'react';
import '../../App.css';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';


function DormeterCard() {
    return (
        <div className='DormeterCard'>
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src="https://nodejs.org/static/images/logos/nodejs-new-pantone-black.png" />
                <Card.Body>
                    <Card.Title>Dormeter</Card.Title>
                    <Card.Text>
                        Dormeter is a website I developed .It utilizes Node.js, Express.js, React.js and a bunch of other js libraries.
                    </Card.Text>
                    <Button href = "https://www.dormeter.com" variant="primary">Go to dormeter.com</Button>
                </Card.Body>
            </Card>
        </div>
    );
};

export default DormeterCard;
